3_1859643320868790_5851357947864959720_n.jpg?_nc_ht=instagram.fbhz6-1.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=OHi0zZK6_k4AX-7Kd0P\u0026tp=19\u0026oh=a2485f799591de2d3b569c877ddfc191\u0026oe=5FCDF57C","edge_media_to_tagged_user":{"edges":[{"node":{"user":{"full_name":"daniela moraes brum","id":"12858954","is_verified":false,"profile_pic_url":"https://instagram.fbhz6-1.fna.fbcdn.net/v/t51.2885-19/s150x150/118384871_337897310684329_5667193968502398887_n.jpg?_nc_ht=instagram.fbhz6-1.fna.fbcdn.net\u0026_nc_ohc=DFrARfNzngwAX_IX3vN\u0026oh=4deda5633959cfd4bf1d98c75e7c7a79\u0026oe=5FCC5909","username":"danimoraesbrum"},"x":0.3003220489,"y":0.0531400966}}]},"fact_check_overall_rating":null,"fact_check_information":null,"gating_info":null,"sharing_friction_info":null,"media_overlay_info":null,"media_preview":null,"owner":{"id":"256405125","username":"feminiismo"},"is_video":false,"accessibility_caption":"Photo shared by Feminismo por Daniela Brum on November 03, 2020 tagging @danimoraesbrum. A imagem pode conter: 1 pessoa, texto que diz \"danimoraesbrum @danibrum Eu passei por um ass\u00e9dio virtual nesse final de semana, o cara comentou na minha foto gr\u00e1vida exatamente isso aqui: \"Inveja da crian\u00e7a que vai passar pela tua bucet*\" Me falaram para denunciar e eu falei que n\u00e3o tinha cabe\u00e7a para ser humilhada em uma delegacia mais uma vez.\".","edge_media_to_caption":{"edges":[{"node":{"text":"A (in)justi\u00e7a brasileira \u00e9 um reflexo de como a nossa sociedade foi constru\u00edda: racista, patriarcal e classista.\n\nA \u201chonra\u201d do estuprador, abusador e violador conta mais do que a da v\u00edtima.\n\nE o judici\u00e1rio brasileiro endossa essa narrativa quando faz uma manobra absurda, inventando o \u201cestupro culposo\u201d.\n\nE \u00e9 exatamente o que est\u00e1 sendo dito em todas as redes: estupro culposo \u00e9 quando n\u00e3o h\u00e1 inten\u00e7\u00e3o de condenar o estuprador rico\u0026branco.\n@danimoraesbrum"}}]},"edge_media_to_com
